import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import { PeopleList } from "pages/PeopleList";

export const App = () => {
  return (
    /* BrowserRout needs to wrap everything */
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          {/* Mount PeopleList.js */}
          <PeopleList />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};
